VALUES ('3251515396004', 'Tartines Apéritives 6+6', '6 tahines préparation à base de cantal, lardons salés, oignons - pain de mie campagne : GARNITURE (58,4%) : Cantal AOP* 46,3%, béchamel (lait demi-écrémé, eau, farine de blé, lait entier en poudre, huile de tournesol, sel, poivre), lardon cuit salé 11 ,5% (poitrine de porc, sel, dextrose de blé, acidifiant : E330, antioxydant : E316, conservateur : E250), eau, oignon 3,8% (oignon, huile de tournesol, antioxydants : E300 et E330), raclette 1,5% (dont conservateur de surface : E235), poivre. (Pourcentages exprimés par rapport à la garniture). *Appellation d\'Origine Protégée. PAIN DE MIE CAMPAGNE (41 ,6%) : Farine de blé (contient farine de blé malté), eau, farine de seigle (farine de seigle, remoulage de seigle, farine de blé, gluten de blé, farine d\'orge torréfiée, malt enzymatique), huile de tournesol, levure, sel, sucre, farine de fève, gluten de blé, malt d\'orge torréfiée 0,17%, émulsifiants : E471 et E481 , acidifiant : E330, antioxydant : E300. (Pourcentage exprimé par rapport au pain). 6 tahines préparation à base d\'emmenta/, noix et raisins - pain de mie aux céréales : GARNITURE (58,4%) : Emmental français 46,3%, béchamel (lait demi-écrémé, eau, farine de blé, lait entier en poudre, huile de tournesol, sel, poivre), eau, noix 5,3%, raisin 5,2% (raisin sec sultanine, agent d\'enrobage : huile de coton), raclette 2,5% (dont conservateur de surface : E235), miel, sel, poivre. (Pourcentages exprimés par rapport à la garniture). PAIN DE MIE AUX CÉRÉALES (41 ,6%) : Farine de blé (contient farine de blé malté), eau, préparation aux céréales 14,5% (avoine, maïs, millet, lin, farine de froment, gluten de blé, sel, farine de seigle), huile de tournesol, levure, sucre, préparation lactée (lactosérum, matière grasse de coprah, lait écrémé, protéines de lait), farine de fève, gluten de blé, malt d\'orge torréfié, émulsifiants : E471 et E481 , acidifiant : E330, sel, antioxydant : E300. (Pourcentage exprimé par rapport au pain). Traces éventuelles de : œuf, soja, arachide, poisson, crustacés, graine de sésame, céleri, moutarde, mollusques.', '', '12.8', '6.6', '21.5', '3.8', '', '12.1', '1.26', '0.496062992125984', '', '0');

